import Link from 'next/link'

const Nav = () => {

    return (

        <div className='bg-gray-500 py-4'>
            <Link href='/sobre'><a></a> Sobre</Link> 
            <Link href='/cadastrar'><a>Cadastre-se</a></Link> 
            <Link href='/entrar'><a>Entrar</a></Link> 
            
            
        </div>

    );

}


export default Nav;
